import React from "react";

import Layout from "../components/Layout";
import resume from "../database/resume";

const Resume = () => {
  const values = Object.values(resume);
  console.log(values);

  const locationExist = (exp) =>
    exp.location ? (
      <>
        , <span>{exp.location}</span>
      </>
    ) : (
      ""
    );

  const renderGithubLink = (exp, expType) => {
    switch (expType) {
      case "professional":
        return "";
      case "project":
        return (
          <h3>
            {" "}
            - <a href={exp.link[1]}>{exp.link[0]}</a>
          </h3>
        );
    }
  };

  const renderExperience = (expType) => (
    <>
      <h3>{expType.toUpperCase()} EXPERIENCE</h3>
      {values[3][expType].map((exp) => {
        return (
          <div className="project">
            <h2 className="project-header">
              {exp.title}
              {locationExist(exp)}
              {renderGithubLink(exp, expType)}
            </h2>
            <p>{exp.subTitle}</p>
            <ul>
              {exp.description.map((desc) => (
                <li>{desc}</li>
              ))}
            </ul>
          </div>
        );
      })}
      <style jsx>
        {`
          h3 {
            color: ${values[9].highlight};
          }
          h2 {
            font-size: 20px;
          }
          ul {
            margin-left: 15px;
          }
          li {
            padding: 5px;
          }
          span {
            font-size: 17px;
            color: gray;
          }
          .project {
            margin: 15px;
          }
          .project-header {
            display: inline-block;
            background-color;
          }
        `}
      </style>
    </>
  );

  return (
    <div className="background">
      <div className="page">
        <div className="bottom-layout">
          <section className="MAIN left-column">
            <div className="name">
              <h1>{values[0]}</h1>
            </div>
            <div className="professional-exp subsection">
              {renderExperience("professional")}
            </div>
            <div className="project-exp subsection">
              {renderExperience("project")}
            </div>
            <div className="education subsection">
              <h3>EDUCATION</h3>
              <h2>
                {values[2].school + " "}
                <span>{values[2].location}</span>
              </h2>
              <p>{values[2].subTitle}</p>
              <ul>
                {values[2].description.map((desc) => (
                  <li>{desc}</li>
                ))}
              </ul>
            </div>
          </section>
          <section className=" SPECS right-column">
            <div className="contact">
              <div className="contact-isLink">
                <ul>
                  {values[1].links.map((link) => (
                    <li>
                      <a href={link}>{link}</a>
                    </li>
                  ))}
                  {values[1].notLinks.map((notLink) => (
                    <p>{notLink}</p>
                  ))}
                </ul>
              </div>
            </div>
            <div className="technology subsection">
              <h3>TECHNOLOGY</h3>
              <ul>
                {values[4].map((tech) => (
                  <li>{tech}</li>
                ))}
              </ul>
            </div>
            <div className="honors subsection">
              <h3>HONORS</h3>
              <p>{values[5].title}</p>
              <p>{values[5].description}</p>
            </div>
            <div className="languages subsection">
              <h3>LANGUAGES</h3>
              <ul>
                {values[6].map((lang) => (
                  <li>{lang}</li>
                ))}
              </ul>
            </div>
            <div className="interests subsection">
              <h3>INTERESTS</h3>
              <ul>
                {values[7].map((int) => (
                  <li>{int}</li>
                ))}
              </ul>
            </div>
            <div className="hobbies subsection">
              <h3>HOBBIES</h3>
              <ul>
                {values[8].map((hobby) => (
                  <li>{hobby}</li>
                ))}
              </ul>
            </div>
          </section>
        </div>
      </div>
      <style jsx>
        {`
          h3 {
            color: ${values[9].highlight};
          }
          a {
            color: ${values[9].highlight};
            text-decoration: none;
            font-weight: 500;
          }
          span {
            color: gray;
            font-size: 20px;
          }
          .background {
            display: flex;
            justify-content: center;
          }
          .page {
            display: flex;
            flex-direction: column;
            border-top: 7px solid ${values[9].highlight};
            border-bottom: 7px solid ${values[9].highlight};
